import * as Pusher from 'pusher';

export function Push() {
    const pusher = new Pusher({
        appId: '1515866',
        key: 'b31399efa1d95a086e20',
        secret: 'dceb1c4e558a9075a8a1',
        cluster: 'ap1'
    });
    const channel = pusher.subscribe('user-notify');
    channel.bind('withdraw-88yykh11166-queue', function(data) {
        console.log(data);
    })
    return(

        <>

        </>
    );
}
